import styles from './TopBar.module.css';

interface ITopBar {
  text: string;
}

export const TopBar = ({ text }: ITopBar) => <div className={styles['top-level-error']}>{text}</div>;

export const TopBarError = ({ text }: ITopBar) => <div className={styles['top-level-error']}>{text}</div>;

export const TopBarWarning = ({ text }: ITopBar) => <div className={styles['top-level-error']}>{text}</div>;
